article_content:
상품은 괜찮은데 포장상태가 영 별로네요..;
포장을 하신건지 아니면 하다마신건지..
다음부터는 주문에 있어 좀 고려해볼것같네요

음식물 흘려도 잘닦이고 좋은데
배송왔을 때 한쪽 모서리가 부서져있었네요;
교환받기 귀찮아서 그냥 씁니다

후기에 찌그러져온게 있길래 걱정했는데 저도이렇게왔어요
뽁뽁이도 없이 왔으니 이럴만 한듯요;;;
교환신청했으니 제대로된걸로 포장잘해서 보내주세요

진짜커요 ㅋㅋㅋㅋㅋㅋ받고 완전 기쁨과 놀람의 도가니탕 맨;;
단점이있다면 너무 하얘서 빨간음식먹고 흘리면 아주미세하게 계속 색이 밴다는점..?
하지만 저렴ㄹ해서 나중에 또 새걸로 사면된다 생각하고 잘쓰고있어요 ㅎㅎ

견고하고 튼튼하고 크고 좋아요~

단점은 김치국물이나 빨간 반찬 흘렸을때 잘 안닦여요 ㅠ
쌔게문지르면 닦기긴합니다 ㅋ;;
